'use strict';
class RequiredCommandDescriptor {
    messageType;
    command;
    constructor() {
        this.messageType = "";
        this.command = null;
    }
    static create(messageType, command) {
        let result;
        result = new RequiredCommandDescriptor();
        result.messageType = messageType;
        result.command = command;
        return result;
    }
    getMessageType() {
        return this.messageType;
    }
    getCommand() {
        return this.command;
    }
}
module.exports = RequiredCommandDescriptor
